window.bookSummaryJSON = "<p>The battle-scarred star carrier <i>Flying Dutchman</i> is finally on her way back to Earth, after an exceptionally successful series of missions that have once again saved the world. The ship needs a serious refit, and her exhausted crew just wants a break from constant clandestine warfare against a vicious and superior enemy. Wishes come true, right? Not for the Merry Band of Pirates.</p> <p>Includes special bonus note from the author.</p>"; 
